CREATE TABLE WorkshopsHelper (
WorkshopID INT NOT NULL PRIMARY KEY,
Name VARCHAR(50) NOT NULL,
Room INT NOT NULL,
Price numeric(10,0),
HourStart VARCHAR(10),
MaxParticipants INT NOT NULL,
WorkshopLeader VARCHAR(40) NOT NULL,
)







DECLARE @iter INT
DECLARE @fasterIter INT
DECLARE @innerIter INT

DECLARE @PriceHelp Money
DECLARE @MaxParticipantsHelp INT
DECLARE @MonthHelp INT
DECLARE @DayHelp INT
DECLARE @HourHelp time
DECLARE @BitHelp BIT
DECLARE @RandHelp INT

SET @iter = 0
SET @fasterIter = 0
WHILE @iter < 81
BEGIN
	SET @iter = @iter + 1
	SET @PriceHelp = CONVERT(MONEY,RAND()*(150-50)+50)
	SET @MaxParticipantsHelp = FlOOR(Rand()*(250-150+1)+150)


END

DECLARE @TimeRangeBegin time = '9:00', @TimeRangeEnd time = '15:00'
DECLARE @TimeSpanInSec int = datediff(second,@TimeRangeBegin, @TimeRangeEnd)

SET @iter = -1
SET @fasterIter = 0
WHILE @iter < 201
BEGIN
	SET @iter = @iter + 1
	SET @fasterIter = @fasterIter + 3
	SET @MaxParticipantsHelp = FlOOR(Rand()*(100-30+1)+30)

	SET @HourHelp = DATEADD(second, Rand(Cast(Newid() AS VARBINARY)) * @TimeSpanInSec,@TimeRangeBegin)

	values (@fasterIter - 2, @iter % 80 + 1, 
		DATEADD(day, 0, (select StartDate from Conferences where ID = @iter % 80 + 1)), 
		(select Name from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter - 2), 
		(select Room from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter - 2), 
		(select Price from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter - 2), 
		@HourHelp, 
		DATEADD(hour, cast(FlOOR(Rand()*(4-1+1)+1) as int), @HourHelp), 
		(select MaxParticipants from DaysOfConferences where DaysOfConferences.ConferenceID = @iter % 80 + 1 and DaysOfConferences.Date = DATEADD(day, 0, (select StartDate from Conferences where ID =@iter % 80 + 1))) - FlOOR(Rand()*(100-50+1)+50),
		(select WorkshopLeader from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter - 2))

		SET @HourHelp = DATEADD(second, Rand(Cast(Newid() AS VARBINARY)) * @TimeSpanInSec,@TimeRangeBegin)

	values (@fasterIter - 1, @iter % 80 + 1, 
		DATEADD(day, 1, (select StartDate from Conferences where ID = @iter % 80 + 1)), 
		(select Name from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter - 1), 
		(select Room from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter - 1), 
		(select Price from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter - 1), 
		@HourHelp, 
		DATEADD(hour, cast(FlOOR(Rand()*(4-1+1)+1) as int), @HourHelp), 
		(select MaxParticipants from DaysOfConferences where DaysOfConferences.ConferenceID = @iter % 80 + 1 and DaysOfConferences.Date = DATEADD(day, 0, (select StartDate from Conferences where ID =@iter % 80 + 1))) - FlOOR(Rand()*(100-50+1)+50),
		(select WorkshopLeader from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter - 1))

		SET @HourHelp = DATEADD(second, Rand(Cast(Newid() AS VARBINARY)) * @TimeSpanInSec,@TimeRangeBegin)

	values (@fasterIter, @iter % 80 + 1, 
		DATEADD(day, 2, (select StartDate from Conferences where ID = @iter % 80 + 1)), 
		(select Name from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter), 
		(select Room from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter), 
		(select Price from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter), 
		@HourHelp, 
		DATEADD(hour, cast(FlOOR(Rand()*(4-1+1)+1) as int), @HourHelp), 
		(select MaxParticipants from DaysOfConferences where DaysOfConferences.ConferenceID = @iter % 80 + 1 and DaysOfConferences.Date = DATEADD(day, 0, (select StartDate from Conferences where ID =@iter % 80 + 1))) - FlOOR(Rand()*(100-50+1)+50),
		(select WorkshopLeader from WorkshopsHelper where WorkshopsHelper.WorkshopID = @fasterIter))

END

SET @iter = 0
WHILE @iter < 201
BEGIN
	SET @iter = @iter + 1
	SET @MonthHelp = FlOOR(Rand()*(4-0+1)+0)
	SET @DayHelp = FlOOR(Rand()*(28-0+1)+0)
	if(@MonthHelp > 1) SET @BitHelp = 0 else SET @BitHelp = 1
	values (@iter, (select ClientID from ClientCompanies where ClientID = @iter % 100 + 1), NULL, 
		DATEADD(month, @MonthHelp, DATEADD(day, @DayHelp, (SELECT StartDate from Conferences where ID = @iter % 80 + 1))), @BitHelp) 

END
while @iter < 301
BEGIN
	SET @iter = @iter + 1
	SET @MonthHelp = FlOOR(Rand()*(4-0+1)+0)
	SET @DayHelp = FlOOR(Rand()*(28-0+1)+0)
	if(@MonthHelp > 1) SET @BitHelp = 0 else SET @BitHelp = 1
	values (@iter, NULL, (select ClientID from Clients where ClientID = @iter % 100 + 1), 
		DATEADD(month, @MonthHelp, DATEADD(day, @DayHelp, (SELECT StartDate from Conferences where ID = @iter % 80 + 1))), @BitHelp) 

END

SET @iter = 0
SET @fasterIter = 0
WHILE @iter < 601
BEGIN
	SET @iter = @iter + 1
	SET @fasterIter = @fasterIter + 3
	SET @DayHelp = @iter % 3
	SET @RandHelp = FlOOR(Rand()*(4-0+1)+0)

	values (@iter, @iter % 300 + 1, (@iter % 300) % 80 + 1, DATEADD(day, @DayHelp, (SELECT StartDate from Conferences where ID = (@iter % 300) % 80 + 1)), 
		(select MaxParticipants from DaysOfConferences where DaysOfConferences.ConferenceID = (@iter % 300) % 80 + 1 and DaysOfConferences.Date = DATEADD(day, @DayHelp, (SELECT StartDate from Conferences where ID = (@iter % 300) % 80 + 1))) / 5 - FlOOR(Rand()*(5-0+1)+0),
		(select MaxParticipants from DaysOfConferences where DaysOfConferences.ConferenceID = (@iter % 300) % 80 + 1 and DaysOfConferences.Date = DATEADD(day, @DayHelp, (SELECT StartDate from Conferences where ID = (@iter % 300) % 80 + 1))) / 7 - FlOOR(Rand()*(5-0+1)+0))

	values (@iter, (select top 1 WorkshopID from Workshops where Workshops.DayOfConferenceConferenceID = (@iter % 300) % 80 + 1 and Workshops.DayOfConferenceDate = DATEADD(day, @DayHelp, (SELECT StartDate from Conferences where ID = (@iter % 300) % 80 + 1))), (select MaxParticipants from Workshops where WorkshopID = (@fasterIter - 2)%600 + 1) / 4 - FlOOR(Rand()*(5-0+1)+0), @fasterIter - 2),
		   (@iter, (select top 1 WorkshopID from Workshops where Workshops.DayOfConferenceConferenceID = (@iter % 300) % 80 + 1 and Workshops.DayOfConferenceDate = DATEADD(day, @DayHelp, (SELECT StartDate from Conferences where ID = (@iter % 300) % 80 + 1)) 
		   and WorkshopID != (select top 1 WorkshopID from Workshops where Workshops.DayOfConferenceConferenceID = (@iter % 300) % 80 + 1 and Workshops.DayOfConferenceDate = DATEADD(day, @DayHelp, (SELECT StartDate from Conferences where ID = (@iter % 300) % 80 + 1)))), (select MaxParticipants from Workshops where WorkshopID = (@fasterIter - 2)%600 + 1) / 6 - FlOOR(Rand()*(5-0+1)+0), @fasterIter - 1),
		   (@iter, (select top 1 WorkshopID from Workshops where Workshops.DayOfConferenceConferenceID = (@iter % 300) % 80 + 1 and Workshops.DayOfConferenceDate = DATEADD(day, @DayHelp, (SELECT StartDate from Conferences where ID = (@iter % 300) % 80 + 1)) order by WorkshopID DESC), (select MaxParticipants from Workshops where WorkshopID = (@fasterIter - 2)%600 + 1) / 6 - FlOOR(Rand()*(5-0+1)+0), @fasterIter)
END

SET @iter = 0
SET @fasterIter = 1
SET @MaxParticipantsHelp = 0
WHILE @iter < 601
BEGIN
	SET @iter = @iter + 1
	SET @MaxParticipantsHelp = (select NumberOfPeople from DayReservations where DayReservationID = @iter)
	SET @innerIter = 0
	while @innerIter < @MaxParticipantsHelp - 1
	BEGIN
		SET @innerIter = @innerIter + 1
		SET @fasterIter = @fasterIter % 1500 + 1
	END
END

SET @iter = 0
SET @innerIter = 1
DECLARE @sum numeric(10,0)

WHILE @iter < 301
BEGIN
	SET @iter = @iter + 1
	SET @BitHelp = (select Cancelled from EntryReservations where ReservationID = @iter)
	if @BitHelp = 0
		SET @sum = (select top 1 ((select sum(dr2.NumberOfPeople)
                 from DayReservations as dr2
                 where dr2.EntryReservationsID = er.ReservationID) * (select top 1 pt.Price
                                                                      from [Price Thresholds] as pt
                                                                      where pt.ConferenceID = conf.ID
                                                                        and er.DateOfReservation > pt.StartingDate
                                                                      order by pt.StartingDate desc)) +
               ((select sum(dr2.NumberOfStudents)
                 from DayReservations as dr2
                 where dr2.EntryReservationsID = er.ReservationID) * (select top 1 pt.StudentPrice
                                                                      from [Price Thresholds] as pt
                                                                      where pt.ConferenceID = conf.ID
                                                                        and er.DateOfReservation > pt.StartingDate
                                                                      order by pt.StartingDate desc)) +
               (select sum(wr.NumberOfPeople * w.price)
                from WorkshopReservations as wr
                       JOIN Workshops as w on wr.WorkshopID = w.WorkshopID
                where wr.DayReservationID in (select dr3.DayReservationID
                                              from DayReservations as dr3
                                              where dr3.EntryReservationsID = er.ReservationID))
  from ClientCompanies as cc
         join EntryReservations as er on cc.ClientID = er.ClientCompaniesClientID
         join DayReservations as dr on er.ReservationID = dr.EntryReservationsID
         join DaysOfConferences as doc on dr.DayOfConferenceID = doc.ConferenceID and dr.DayOfConferenceDate = doc.Date
         join Conferences as conf on doc.ConferenceID = conf.ID
  where er.ClientCompaniesClientID is not null
    and er.ReservationID = @iter)

		DATEADD(day, FlOOR(Rand()*(7-0+1)+0), (select DateOfReservation from EntryReservations where ReservationID = @iter)))
		SET @innerIter = @innerIter + 1
END

DROP TABLE WorkshopsHelper

